text69034.addInnerText('<div id=\"text69034\"><a id=\"text69034anc\" style=\"display:block;height:0px;width:0px;\"></a>\n<p  legLH=\"1.107\" style=\"margin-left:0px;text-indent:0px;line-height:1.107;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text69034Font1\"  >Den mest miljøvennlige maten er den naturen lager helt av seg selv. Bær, sopp, ville urter, skjell og vilt er blant delikatessene som naturen har å by på. Mye av ugresset er også spiselig: Unge skudd av løvetann, skvallerkål og brennenesle kan brukes som grønnsaker. Dyrk eventuelt egne grønnsaker, bær og frukt. </span ><span class=\"text69034Font2\" style=\"background-color:transparent\" >\n</span ></p >\n</div>\n');
